    const context = useContext(FullNameContext)
    return (
        <FullNameProvider>
            <div>
                <h1>Context API</h1>
                <div className="input-group mb-3">
                    <button className="btn btn-outline-secondary" type="button" id="button-addon1">Button</button>
                    <input className="form-control" onChange={(e) => context.handleChange(e)} />
                </div>
                {
                    ContextAPI.fullName && <p className='text-center'>...</p>
                }
            </div>
        </FullNameProvider>
    )
}
